column5:
Fix infinite recursion bug. In some cases with closures.

Like this:

func x() func(*view) {
	return func(view *view) {
		view.<cursor>
	}
}

Closure's "view" was declared in a wrong scope.

Fix nasty bug with transformation of '?' symbols in .a files.

In Go:
	func abc(int)

is the same as:
	func abc(_ int)

On the other hand:
	type ABC struct { _ MyStruct }

is not the same as:
	type ABC struct { MyStruct }

So, I'm kinda trying to apply a hack for that. Therefore I'm changing
'?' to '__' and process it as it's a blank space in case of structs. And
as '_' in case of function arguments.

I need to improve this later and remove that ugly hack.

One more fix for type inference.

This one fixes type not being full paths in cases like that:

var array []interface{}

func ...() {
	vector.Vector(array).#
}

The problem was that 'vector.Vector' due to type inference process was
transformed to a 'Vector' and got lost its full path info. This patch
should fix that. Also simplifies few things.
